import './App.css';
import './css/templatemo-style.css';
import './css/bootstrap.css';
import { Index } from './components/Index';
import { Navigation } from './components/Navigation';
import { Socials } from './components/Socials';

function App() {
  return (
    <>
      <Navigation />
      <Socials />
      <Index />
    </>
  );
}

export default App;
